// Declarando as rotas para renderizar os item de acordo com a rota
const routes = [
  {
    routesSwitch: [
      {
        header: [
          {
            name: "Home",
            path: "/",
          },
          {
            name: "News",
            path: "/news",
          },
          {
            name: "Settings",
            path: "/settings",
          },
        ],
        sidebar: [
          {
            name: "My Account",
            path: "/account",
          },
          {
            name: "All Games",
            path: "/",
          },
          {
            name: "My Library",
            path: "/library",
          },
          {
            name: "Add Games",
            path: "/add-games",
          },
        ],
      },
    ],
  },
];

export { routes };
